        return EXIT_FAILURE;
    }

    while (file >> word) {
        if (word == wordToFind) {
            ++wordCount;
        }
    }

    file.close();

    std::cout << "The word '" << wordToFind << "' occurred " << wordCount << " times in the file." << std::endl;

    return EXIT_SUCCESS;
}
